import RandomMonster1 from '../randomMaster'; 
import NavComp from '../components/NavComp';
import Collapse from 'react-bootstrap/Collapse';
import { decisionN  } from '../randomMaster';
import useRandom from './useRandom';


export default function Reuslt(){
    const [open, setOpen] = useState(false);


    const {verb,setVerb, landmark,setLandMark,treasure,setTreasure,npc,setNPC, monster,setMonster,numberMonster,setNumberMonster,numberNPC,setNumberNPC,randomLandMarkEffect,setRandomEffect} = useRandom()


    if(decisionN === 1){
        return(
            <>
            <div className="npc-stats">
                <span
                    onClick={() => setOpen(!open)}
                    aria-controls="example-collapse-text"
                    aria-expanded={open}
                ><i className="bi bi-chevron-down"></i></span>
                <div className='hodler'>
                    <h1>{}</h1>
                    <Collapse in={open}>

                        <div id="example-collapse-text" className="text-light">
